import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class WholeSite extends React.Component {
	render() {
		return (
			<mainArtist />
		);
	}
}

class MainArtist extends React.Component {
	render() {
		return (
			<div className="mainArtistInput">
			<input type="text"></input>
			</div>
		);
	}
}

// ========================================

ReactDOM.render(
  <wholeSite />,
  document.getElementById('root')
);
